<h2 class="has-text-align-center">February is Dating Violence Awareness Month</h2>
<!-- /wp:heading -->

<!-- wp:group {"layout":{"type":"flex","flexWrap":"nowrap","justifyContent":"center"}} -->
<div class="wp-block-group"><!-- wp:image {"align":"center","id":786,"sizeSlug":"full","linkDestination":"none"} -->
