<!-- /wp:image -->

<!-- wp:image {"id":432,"width":119,"height":167,"sizeSlug":"full","linkDestination":"none","style":{"color":{"duotone":"unset"},"border":{"radius":"20px"}}} -->
<figure class="wp-block-image size-full is-resized has-custom-border"><img src="https://ldev.ta2ta.org/wp-content/uploads/2019/10/ribbon_orange.png" alt="orange ribbon" class="wp-image-432" style="border-radius:20px" width="119" height="167"/></figure>
<!-- /wp:image --></div>
<!-- /wp:group --></div></div>
<!-- /wp:uagb/container --></div></div>
<!-- /wp:uagb/container -->

<!-- wp:paragraph {"align":"center"} -->
<p class="has-text-align-center">Dating violence is violence committed by a person who is or has been in a social relationship of a romantic or intimate nature with the victim and where the existence of such a relationship shall be determined based on a consideration of the following factors: the length of the relationship; the type of relationship; and the frequency of interaction between the persons involved in the relationship. February is Dating Violence Awareness Month. This month is dedicated to bringing greater awareness to dating violence, including teen dating violence; however, we encourage you to promote awareness all year round. This page has resources and tools, ideas to promote awareness in your community, and OVW-funded events and webinars on dating and teen dating violence.</p>
<!-- /wp:paragraph -->

